import React, { Component } from 'react';
import './headingeffect.css';
import {Link} from 'react-scroll';

class FrontPageText extends Component {

  render() {
    return (
    	<div >
    		<p 
        style={{fontFamily:'Cinzel',color:'black',position:'absolute',top:180,left:100,
        fontSize:70}}> 
        ANJALI JAIN</p>
    		<p className='p1' style={{position:'absolute',top:260,left:230}}>UI/UX Designer |</p>
        <p className='p2' style={{position:'absolute',top:260,left:230}}>Web Developer |</p>
        <p style={{position:'absolute',top:340,left:100,fontSize:23}}> 
        I love to explore about new technologies and</p>
        <p style={{position:'relative',top:8,left:60,fontSize:23}}>to stay updated about them.</p>
        <br/>

         <p>I believe that right innovation and
         <br/> integrations can work
          wonders.</p>


          <div style={{position:'absolute',top:500,left:90}}>jainanjali043@gmail.com</div>
         <div className="arrow">
         <Link
            activeClass="active"
            to="about"
            spy={true}
            smooth={true}
            offset={0}
            duration= {500}
          ><span className='mouse'>
            <span className='mouse-movement'>
            </span>
          </span>
          <p style={{position:'absolute',top:500,left:300}}>See portfolio</p>
        </Link>
    	</div>
      </div>
    );
  }
}

export default FrontPageText;
